import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
import "../css/Home.css";

function Home() {
  const navigate = useNavigate();

  const handleButtonClick = () => {
    // Redirect to "http://localhost:8080/index.html"
    window.location.href = "http://localhost:8080/index.html";
  };

  return (
    <>
      <section id="header" className="main">
        <div className="content">
          <h1>Let's see the world together</h1>
          <h4>
            DrishtiConnect helps people needing sighted support with volunteers
            through live video call.
          </h4>

          <Link to="/Volunteers">
            <Button variant="primary">Call us</Button>
          </Link>

          <Button variant="primary" onClick={handleButtonClick}>
            Redirect to External Link
          </Button>
        </div>
      </section>
    </>
  );
}

export default Home;
